//创建’外壳‘组件App

class App extends React.Component {
    render() {
        return (
            <div>
                <h2>Hello World</h2>
            </div>
        )
    }
}

//默认暴露与分别暴露*
//暴露App组件之后，index.js入口文件才能引入该组件并渲染到页面上
export default App;
